(1, 'CONTACTUS', 'html', 'Job Seeker', 'To Send when admin fill contact us form', '', 'Active', 'Contact Us Form Details', '<b>Dear Administrator,</b><br>\r\n<br>#Contact_Name#&nbsp;has filled up the contact us form.<br><br>Below is the details.<br>\r\n<br>\r\n<b>Name:</b> #Contact_Name#<br>\r\n<b>Phone:</b> #Contact_Phone#<br>\r\n<b>Email:</b> #Contact_Email#<br>\r\n<b>Subject:</b> #Contact_Subject#<br>\r\n<b> Message:</b> #Contact_Message#<br><br>Thanks!&nbsp; #MailFooter#', 'Contactez-nous Formulaire D√©tails', '<div>Cher Administrateur,</div><div><br></div><div>#Contact_Name# a rempli le formulaire de contact.</div><div><br></div><div>Voici les d√©tails.</div><div><br></div><div>Nom: #Contact_Name#</div><div>T√©l√©phone: #Contact_Phone#</div><div>Email: #Contact_Email#</div><div>Sujet: #Contact_Subject#</div><div>Message: #Contact_Message#</div><div><br></div><div>Merci! #MailFooter#</div>', 'Formulario de contacto', 'Estimado Administrador,<br>\r\n<br>\r\n#Contact_Name# ha llenado de formulario de contacto<br>\r\n<br>\r\nA continuaci√≥n se muestra el detalle.<br>\r\n<br>\r\nNombre: #Contact_Name#<br>\r\n<br>\r\ntel√©fono : #Contact_Phone#<br>\r\n<br>\r\nEmail: #Contact_Email#<br>\r\n<br>\r\nsujeto: #Contact_Subject#<br>\r\n<br>\r\nmensaje: #Contact_Message#<br>\r\n<br>\r\nGracias!&nbsp; #MailFooter#'),
(4, 'CUSTOMER_FORGETPASSWORD', 'html', 'Job Seeker', 'Mail Send to admin for the password of admin panel (may be not used)', '', 'Inactive', 'Password Request', 'Dear #Name#, <br><br>Below is the requested email and the password. <br><br>Email: #Email# <br>Password: #Password# <br><br>We look forward to a long association with you. <br><br>Thanks!&nbsp;<br><br>&nbsp;#MailFooter#', 'Demande de mot de passe', 'Cher #Name#,<br>\r\n<br>\r\nCi-dessous l\'email et le mot de passe demand√©,<br>\r\n<br>\r\nEmail: #Email#<br>\r\n<br>\r\nMot de passe: #Password#<br>\r\n<br>\r\nNous nous r√©jouissons d\'une longue association avec vous. <br>\r\n<br>\r\nMerci!  #MailFooter#', 'Solicitud de contrase√±a', 'Querido #Name#,<br>\r\n<br>\r\nA continuaci√≥n se muestra el correo electr√≥nico solicitado y la contrase√±a. <br>\r\n<br>\r\nE-mail: #Email#<br>\r\n<br>\r\nContrase√±a: #Password#<br>\r\n<br>\r\nEsperamos una larga relaci√≥n con usted. <br>\r\n<br>\r\nGracias!  #MailFooter#<br>'),
(5, 'MEMBER_REGISTRATION_USER', 'html', 'Job Seeker', 'To notify the user when a new registration done from the web and App', '', 'Active', 'Member registration on EATCAYMAN', 'Dear&nbsp; #NAME#,<br><br>Welcome, you are successfully registered on EatCayman. <br>Your login details are as follows.<br><br>Email:&nbsp; #EMAIL#<br>#PASSWORD#<br>\r\n<br>#SOCIALNOTES#<br><br>#MAILFOOTER#', 'Inscription de membre sur EatCayman', 'Dear&nbsp; #NAME#,<br><br>Welcome, you are successfully registered on EatCayman.&nbsp;<br>Your login details are as follows.<br><br>Email:&nbsp; #EMAIL#<br>#PASSWORD#<br><br>#SOCIALNOTES#<br><br>#MAILFOOTER#', 'Registro de miembro en EatCayman', 'Dear&nbsp; #NAME#,<br><br>Welcome, you are successfully registered on EatCayman.&nbsp;<br>Your login details are as follows.<br><br>Email:&nbsp; #EMAIL#<br>#PASSWORD#<br><br>#SOCIALNOTES#<br><br>#MAILFOOTER#'),
(27, 'RIDER_INVOICE', 'html', 'Job Seeker', '', '', 'Inactive', 'Your Trip Invoice Details', '#details#', 'Vos d√©tails de facture de voyage', '#details#<br>', 'Los detalles de su factura de viaje', '#details#<br>'),
(30, 'ACCOUNT_STATUS', 'html', 'Job Seeker', 'To Notify driver about their vehicle status', '', 'Active', 'Your Account Details', 'Dear&nbsp; #NAME#,<br><br>Email: #EMAIL#,<br><br>Your Status as follows.<br>#details#<br><br>#MAILFOOTER#', 'D√©tails de votre compte', '<div>Cher&nbsp; #NAME#,</div><div><br></div><div>Email: #EMAIL#,</div><div><br></div><div>Votre statut comme suit.</div><div>#details#<br></div><div><br></div><div>#MAILFOOTER#</div>', 'Detalles de su cuenta', '<div>Estimado #NAME#,</div><div>Correo electr√≥nico: #EMAIL#,<br></div><div>Su estado de la siguiente manera.<br></div><div>#details#<br></div><div><br></div><div>#MAILFOOTER#</div>'),
(31, 'DOCCUMENT_UPLOAD', 'html', 'Job Seeker', '', '', 'Inactive', 'Driver Documents Uploads details', 'Dear Administrator, <br>\r\n<br>#Company# has Uploaded all Documents. Below is the details. <br>\r\n<br>Username: #Name#<br>\r\n<br>Email: #Email# <br>\r\n<br>Regards,<br>\r\n<br>#SITE_FOOTER#', 'D√©tails du t√©l√©chargement des documents du pilote', '<div>Cher Administrateur,</div><div><br></div><div>#Company# a t√©l√©charg√© tous les documents. Voici les d√©tails.</div><div><br></div><div>Nom d\'utilisateur: #Name#</div><div><br></div><div>Email: #Email#</div><div><br></div><div>Cordialement,</div><div><br></div><div>#SITE_FOOTER#</div>', 'Documentos del conductor Carga detalles', '<div>Estimado administrador,</div><div><br></div><div>#Company# ha subido todos los documentos. A continuaci√≥n est√°n los detalles.</div><div><br></div><div>Nombre de usuario: #Name#</div><div><br></div><div>Correo electr√≥nico: #Email#</div><div><br></div><div>Saludos,</div><div><br></div><div>#SITE_FOOTER#</div>'),
(32, 'PROFILE_UPLOAD', 'html', 'Job Seeker', '', '', 'Inactive', 'Documents Uploads details', 'Dear Administrator, <br>\r\n<br>#USER# has Uploaded all Documents. Below is the details. <br>\r\n<br>Username: #Name#<br>\r\n<br>Email: #Email# <br>\r\n<br>Regards,<br>\r\n<br>#SITE_FOOTER#', 'Compte membres suppression Demande', '<div>Cher Administrateur,</div><div><br></div><div>#USER# a t√©l√©charg√© tous les documents. Voici les d√©tails.</div><div><br></div><div>Nom d\'utilisateur: #Name#</div><div><br></div><div>Email: #Email#</div><div><br></div><div>Cordialement,</div><div><br></div><div>#SITE_FOOTER#</div>', 'Cuenta de Miembro Borrado Solicitud', '<div>Estimado administrador,</div><div><br></div><div>#USER# ha descargado todos los documentos. Aqu√≠ est√°n los detalles.</div><div><br></div><div>Nombre de usuario: #Name#</div><div><br></div><div>Correo electr√≥nico: #Email#</div><div><br></div><div>Atentamente,</div><div><br></div><div>&nbsp;#SITE_FOOTER#</div>'),
(33, 'VEHICLE_BOOKING', 'html', 'Job Seeker', 'To Notify Driver for vehicle add and activate soon', '', 'Active', 'Your Vehicle Details', 'Dear&nbsp; #NAME#,<br><br>Email: #EMAIL#,<br>Your Status as follows.#details#<br><br>#MAILFOOTER#', 'D√©tails de votre v√©hicule', '<div>Cher #NAME#,</div><div><br></div><div>Email: #EMAIL#,</div><div>Votre statut comme suit: #details#</div><div><br></div><div>#MAILFOOTER#</div>', 'Los detalles de tu veh√≠culo', '<div>querido #NAME#,</div><div><br></div><div>Correo electr√≥nico: #EMAIL#,</div><div>Su estado de la siguiente manera. #Detalles#</div><div><br></div><div>#MAILFOOTER#</div>'),
(34, 'DRIVER_REGISTRATION_ADMIN', 'html', 'Job Seeker', 'To Notify Admin when A New Driver Register From Web and App', '', 'Active', 'Driver registration on EatCayman', '<b>Dear</b> Administrator,\r\n<br><br>New Driver has been registered on EatCayman. Registration details are as follows.\r\n<br><span><br>Name: #NAME#<br><br>Email: #EMAIL#</span>\r\n<br><span><br><br><b>Thanks!&nbsp; #MAILFOOTER#</b></span><span><br>\r\n</span>', 'Driver registration on EatCayman', '<b>Dear</b>&nbsp;Administrator,&nbsp;<br><br>New Driver has been registered on EatCayman. Registration details are as follows.&nbsp;<br><br>Name: #NAME#<br><br>Email: #EMAIL#&nbsp;<br><br><br><b>Thanks!&nbsp; #MAILFOOTER#</b><br>', 'Driver registration on EatCayman', '<b>Dear</b>&nbsp;Administrator,&nbsp;<br><br>New Driver has been registered on EatCayman. Registration details are as follows.&nbsp;<br><br>Name: #NAME#<br><br>Email: #EMAIL#&nbsp;<br><br><br><b>Thanks!&nbsp; #MAILFOOTER#</b><br>'),
(35, 'COMPANY_REGISTRATION_ADMIN', 'html', 'Job Seeker', 'To Notify Admin when A New Restaurant Register From Web and App', '', 'Active', 'Restaurant registration on EatCayman', 'Dear Administrator, <br><br>New Restaurant has been registered on EatCayman. Registration details are as follows. <br><span><br>Name: #NAME#<br><br>Email: #EMAIL#</span> <br><span><br><br>Thanks! <br>#MAILFOOTER#<br>\r\n</span>', 'Enregistrement de la soci√©t√© sur EatCayman', '<div><span><div>Cher Administrateur,</div><div><br></div><div>Nouvelle soci√©t√© a √©t√© enregistr√©e sur EatCayman. Les d√©tails d\'inscription sont les suivants.</div><div><br></div><div>Pr√©nom: #NAME#</div></span><span><div><br></div><div>Email: #EMAIL#</div><div><br></div><div><br></div><div>Merci!</div><div>#MAILFOOTER#</div>\r\n</span></div>', 'Registro de la compa√±√≠a en EatCayman', '<span><div>Estimado administrador,</div><div><br></div><div>Nueva compa√±√≠a ha sido registrada en EatCayman. Los detalles de registro son los siguientes.</div><div><br></div><div>Nombre: #NAME#</div></span><span><div>Correo electr√≥nico: #EMAIL#<br></div><div><br></div><div>¬°Gracias!</div><div>#MAILFOOTER#</div>\r\n</span>'),
(36, 'DRIVER_REGISTRATION_USER', 'html', 'Job Seeker', 'To notify the Driver when a new registration done From the web and App', '', 'Active', 'Driver registration on EatCayman', 'Dear&nbsp; #NAME#,<br><br>Welcome, you are successfully registered on EatCayman.&nbsp; Your login details are as follows.<br><br>Email: #EMAIL#<br><br>#PASSWORD#<br>\r\n<br><br>#SOCIALNOTES#<br>#MAILFOOTER#', 'Enregistrement du pilote sur EatCayman', '<div>Cher #NAME#,</div><div><br></div><div>Bienvenue, vous √™tes enregistr√© avec succ√®s sur EatCayman. Vos informations de connexion sont les suivantes.</div><div><br></div><div>Email: #EMAIL#</div><div><br></div><div>#PASSWORD#<br><br></div><div>#SOCIALNOTES#<br></div><div>#MAILFOOTER#</div>', 'Registro de controlador en EatCayman', '<div>Estimado #NAME#,</div><div><br></div><div>Bienvenido, est√° registrado con √©xito en EatCayman. Sus detalles de inicio de sesi√≥n son los siguientes.</div><div><br></div><div>Email: #EMAIL#</div><div><br></div><div>#PASSWORD#</div><div><br></div><div>#SOCIALNOTES#<br></div><div># MAILFOOTER #</div>'),
(37, 'COMPANY_REGISTRATION_USER', 'html', 'Job Seeker', 'To Notify the Restaurant when a new registration done From Web And App', '', 'Active', 'Restaurant registration on EatCayman', 'Dear&nbsp; #NAME#,<br><br>Welcome, you have successfully registered on EatCayman.&nbsp; Your login details are as follows.<br>--------------------------------------------------------<br>Email<b>:</b> #EMAIL#<br>&nbsp;#PASSWORD#<br>--------------------------------------------------------<br>Once you have successfully registered, you need to visit our website for the complete setup of your restaurant details and menu.<b><br></b><br>#MAILFOOTER#', 'Enregistrement de la soci√©t√© sur EatCayman', '<div>Cher #NAME#,</div><div><br></div><div>Bienvenue, vous √™tes enregistr√© avec succ√®s sur EatCayman. Vos informations de connexion sont les suivantes.</div><div><br></div><div>Email: #EMAIL#</div><div><br></div><div>#PASSWORD#<br></div><div><br></div><div>#MAILFOOTER#</div>', 'Registro de la compa√±√≠a en EatCayman', '<div>Estimado&nbsp; #NAME#,</div><div><br></div><div>Bienvenido, est√° registrado con √©xito en EatCayman. Sus detalles de inicio de sesi√≥n son los siguientes.</div><div><br></div><div>Correo electr√≥nico: #EMAIL#</div><div><br></div><div>#PASSWORD#</div><div><br></div><div>#MAILFOOTER#</div>'),
(38, 'MANUAL_TAXI_DISPATCH_DRIVER', 'html', 'Job Seeker', '', '', 'Inactive', 'Manual Taxi Dispatch Details', '<b>Dear </b>#Driver#,<br>\n<br>A Ride has been scheduled with&nbsp;#Rider#.<br>\n<br>Below are the details.<br>\n<br>\n<b>Rider Name:</b> #Rider#<br><br>\n<b>Booking No:</b> #BookingNo#<br><br>\n<b>From Address:</b> #SourceAddress#<br><br>\n<b>To Address:</b> #DestinationAddress#<br><br>\n<b>Booking Date:</b> #Ddate#<br>\n<br><br>\n<b> Thanks!&nbsp; #MailFooter#</b>', 'D√©tails de l\'envoi manuel de taxi', '<div>Cher #Driver#,</div><div><b><br></b></div><div>Un Ride a √©t√© programm√© avec #Rider#.</div><div><b><br></b></div><div>Voici les d√©tails.</div><div><b><br></b></div><div>Nom du coureur: #Rider#</div><div><b><br></b></div><div>Num√©ro de r√©servation: #BookingNo#</div><div><b><br></b></div><div>De l\'adresse: #SourceAddress#</div><div><b><br></b></div><div>Pour adresse: #DestinationAddress#</div><div><b><br></b></div><div>Date de r√©servation: #Ddate#</div><div><b><br></b></div><div><b><br></b></div><div>Merci! #MailFooter#</div>', 'Detalles de despacho manual de taxis', '<div>Estimado #Driver#,</div><div><b><br></b></div><div>Un paseo ha sido programado con #Rider#.</div><div><b><br></b></div><div>A continuaci√≥n est√°n los detalles.</div><div><b><br></b></div><div>Nombre del ciclista: #Rider#</div><div><b><br></b></div><div>No de reserva: #BookingNo#</div><div><b><br></b></div><div>Desde la direcci√≥n: #SourceAddress#</div><div><b><br></b></div><div>Para dirigirse a: #DestinationAddress#</div><div><b><br></b></div><div>Fecha de reserva: #Ddate#</div><div><b><br></b></div><div><b><br></b></div><div>¬°Gracias! #MailFooter#</div>'),
(39, 'MANUAL_TAXI_DISPATCH_RIDER', 'html', 'Job Seeker', '', '', 'Inactive', 'Manual Taxi Dispatch Details', '<b>Dear </b>#Rider#,<br>\r\n<br>You are assigned to ride with #Driver#.<br>\r\n<br>Below is the details.<br>\r\n<br>\r\n<b>Driver Name:</b> #Driver#<br>\r\n<br>\r\n<b>Booking No:</b> #BookingNo#<br>\r\n<br>\r\n<b>From Address:</b> #SourceAddress#<br>\r\n<br>\r\n<b>To Address:</b> #DestinationAddress#<br>\r\n<br>\r\n<b>Booking Date:</b> #Ddate#<br>\r\n<br>\r\n<br>\r\n<b> Thanks!&nbsp; #MailFooter#</b>', 'D√©tails manuels d\'exp√©dition de taxi', '<b>Dear #Rider#,</b><br>\r\n<br><div>Vous √™tes assign√© √† monter avec&nbsp;<b>#Driver#.</b><br>\r\n<br>Voici les d√©tails.<br><br><b>Nom du </b><b>Conducteur</b><b>:</b> #Driver#<br></div><div>\r\n<br><span><b>Num√©ro de </b><b>R√©servation</b></span><b>:</b> #BookingNo#<br>\r\n<br><b>De&nbsp;Adresse:</b> #SourceAddress#<br><div><pre><b>√Ä Adresse:</b> #DestinationAddress#</pre></div>\r\n<span><b>Date de </b><b>r√©servation</b></span><b>:</b> #Ddate#<br><br>Merci&nbsp;<b>!<br>#MailFooter#</b></div>', 'Detalles de despacho manual de taxis', '<div>Querido #Rider#,</div><div><b><br></b></div><div>Usted est√° asignado a viajar con #Driver#.</div><div><b><br></b></div><div>A continuaci√≥n est√°n los detalles.</div><div><b><br></b></div><div>Nombre del controlador: #Driver#</div><div><b><br></b></div><div>No de reserva: #BookingNo#</div><div><b><br></b></div><div>Desde la direcci√≥n: #SourceAddress#</div><div><b><br></b></div><div>Para dirigirse a: #DestinationAddress#</div><div><b><br></b></div><div>Fecha de reserva: #Ddate#</div><div><b><br></b></div><div><b><br></b></div><div>¬°Gracias! #MailFooter#</div>'),
