(70, 'USER_ORDER_DELIVER_INVOICE', 'html', 'Job Seeker', 'To Send User When Order Delivered', '', 'Active', 'Your EatCayman order has been delivered', '<b>Dear&nbsp;</b>#Rider#,<br><br>Thanks for using EatCayman!&nbsp;<br>Your order from #RESTAURANTNAME# has been delivered.<br>Looking forward to serving you again.<br><br>#details#<br><br><b>Thanks!&nbsp; #MailFooter#</b><br>', 'Your EatCayman order has been delivered', '<b>Dear&nbsp;</b>#Rider#,<br><br>Thanks for using EatCayman!&nbsp;Your order from #RESTAURANTNAME# has been delivered.Looking forward to serving you again.<br><br>#details#<br><br><b>Thanks!&nbsp; #MailFooter#</b><br>', 'Your EatCayman order has been delivered', '<b>Dear&nbsp;</b>#Rider#,<br><br>Thanks for using EatCayman!&nbsp;Your order from #RESTAURANTNAME# has been delivered.Looking forward to serving you again.<br><br>#details#<br><br><b>Thanks!&nbsp; #MailFooter#</b><br>'),
(71, 'MANUAL_CANCEL_TRIP_ADMIN_TO_COMPANY', 'html', 'Job Seeker', 'To Send Restaurant When Order Cancelled by Admin', '', 'Active', 'Booking cancelled by admin', '<b>Dear&nbsp;</b>#Company#,<br><br>Booking #BookingNo# has been cancelled . Please Contact Administrator if you have any query.<br><br><b>Thanks! #MailFooter#</b>', 'Booking cancelled by admin', '<div><b>Dear&nbsp;</b>#Company#,<br><br>Booking #BookingNo# has been cancelled . Please Contact Administrator if you have any query.<br><br><b>Thanks! #MailFooter#</b><br></div>', 'Booking cancelled by admin', '<div><b>Dear&nbsp;</b>#Company#,<br><br>Booking #BookingNo# has been cancelled . Please Contact Administrator if you have any query.<br><br><b>Thanks! #MailFooter#</b><br></div>'),
(72, 'COMPANY_DECLINE_ORDER', 'text', 'Job Seeker', 'To Send Decline Order When Restaurant', '', 'Active', 'Your EatCayman order has been Decline', '<b>Dear Administrator\r\n<br>\r\nRestaurant: #RESTAURANTNAME# has declined your order request.Below is the Order details.<br>\r\n<br>\r\n<b>User Name:</b> #USERNAME#<br><br>\r\n<b>Order No:</b> #ORDERNO#<br>\r\n<br>\r\n<b>Reason :</b> #MSG#<br>\r\n<br>\r\n\r\n<br>\r\n<b>\r\nThanks!&nbsp; #MailFooter#</b></b>', NULL, '<b>Dear Administrator\r\n<br>\r\nRestaurant: #RESTAURANTNAME# has declined your order request.Below is the Order details.<br>\r\n<br>\r\n<b>User Name:</b> #USERNAME#<br><br>\r\n<b>Order No:</b> #ORDERNO#<br>\r\n<br>\r\n<b>Reason :</b> #MSG#<br>\r\n<br>\r\n\r\n<br>\r\n<b>\r\nThanks!&nbsp; #MailFooter#</b>', NULL, '<b>Dear Administrator\r\n<br>\r\nRestaurant: #RESTAURANTNAME# has declined your order request.Below is the Order details.<br>\r\n<br>\r\n<b>User Name:</b> #USERNAME#<br><br>\r\n<b>Order No:</b> #ORDERNO#<br>\r\n<br>\r\n<b>Reason :</b> #MSG#<br>\r\n<br>\r\n\r\n<br>\r\n<b>\r\nThanks!&nbsp; #MailFooter#</b>'),
(73, 'COMPANY_DECLINE_ORDER_TO_USER', 'text', 'Job Seeker', 'To Send Decline Order When Restaurant', '', 'Active', 'Your EatCayman order has been Decline', '<b>Dear </b>#USERNAME#,<br>\r\n<br>\r\n<br>\r\nRestaurant name #RESTAURANTNAME# has declined your order request.Below is the Order details.<br>\r\n<br>\r\n<b>Order No:</b> #ORDERNO#<br>\r\n<br>\r\n<b>Reason :</b> #MSG#<br>\r\n<br>\r\n\r\n<br>\r\n<b>\r\nThanks!&nbsp; #MailFooter#</b>', 'Your EatCayman order has been Decline', '<b>Dear </b>#USERNAME#,<br>\r\n<br>\r\n<br>\r\nRestaurant name #RESTAURANTNAME# has declined your order request.Below is the Order details.<br>\r\n<br>\r\n<b>Order No:</b> #ORDERNO#<br>\r\n<br>\r\n<b>Reason :</b> #MSG#<br>\r\n<br>\r\n\r\n<br>\r\n<b>\r\nThanks!&nbsp; #MailFooter#</b>', 'Your EatCayman order has been Decline', '<b>Dear </b>#USERNAME#,<br>\r\n<br>\r\n<br>\r\nRestaurant name #RESTAURANTNAME# has declined your order request.Below is the Order details.<br>\r\n<br>\r\n<b>Order No:</b> #ORDERNO#<br>\r\n<br>\r\n<b>Reason :</b> #MSG#<br>\r\n<br>\r\n\r\n<br>\r\n<b>\r\nThanks!&nbsp; #MailFooter#</b>');
