(63, 1, 'Active', 3, 'Coming Soon', 'Coming Soon', 'O√π puis-je avoir de l\'aide ?', 'Il existe plusieurs variantes des passages du Lorem Ipsum, mais la plupart ont subi d‚Äôalt√©ration dans la forme, par humour inject√©, ou randomis√©s les mots qui ne semblent pas m√™me un peu cr√©dibles.', '¬øD√≥nde puedo conseguir ayuda?', 'Hay muchas variaciones de los pasajes de Lorem Ipsum disponibles, pero la mayor√≠a ha sufrido alteraci√≥n de alguna forma, por humor inyectado o aleatorios palabras que no se ven un poco cre√≠bles.', 'Front'),
(64, 3, 'Active', 2, 'Coming Soon', 'Coming Soon', 'D\'o√π viennent-elles ?', 'Il a des racines dans un morceau de la litt√©rature latine classique de 45 avant JC, ce qui en fait plus de 2000 ans.', '¬øDe d√≥nde viene?', 'Tiene ra√≠ces en una pieza de la literatura latina cl√°sica del 45 A.C., lo que es m√°s de 2000 a√±os de antig√ºedad. Contrariamente a la creencia popular, el Lorem Ipsum no es texto simplemente al azar.', 'Front');
