INSERT INTO `homecontent` (`id`, `vCode`, `BannerBgImage`, `BannerBigTitle`, `BannerSmallTitle`, `BannerContent`, `FirstSectionLeftImage`, `FirstSectionHeading`, `FirstParaTitle`, `FirstParaContent`, `SecondParaTitle`, `SecondParaContent`, `ThirdParaTitle`, `ThirdParaContent`, `MidFirstImage`, `MidFirstTitle`, `MidFirstContent`, `MidSecImage`, `MidSecTitle`, `MidSecContent`, `MidThirdImage`, `MidThirdTitle`, `MidThirdContent`, `ThirdLeftImg1`, `ThirdLeftImg2`, `ThirdLeftImg3`, `ThirdRightTitle`, `ThirdRightContent`, `PlayStoreImg`, `AppStoreImg`, `AboutUsBgImage`, `AboutUsTitle`, `AboutUsSecondTitle`, `AboutUsContent`, `HomeRestuarantSectionLabel`, `eStatus`) VALUES
(1, 'EN', 'chowcall-homewallpaper1536004244.jpg', 'FEED YOUR FREEDOM', 'DRIVEN TO SERVE', '<p>Favorite Food from Local Restaurants<br />\r\nDelivered to your Barracks, Home, or Office&nbsp;<span><a href=\"about\">Find Restaurants&nbsp;</a></span></p>', 'why-choose-img1531119409.png', 'WHY CHOOSE US', 'FRESH FOOD MADE WITH HONEST INGREDIENTS', '<p>To present you nutritionally&nbsp;balanced luscious delicacies made with the choicest of ingredients, our chefs will create your mouthwatering menu that is nutritionally balanced and tasty, full of goodness of vegetables and fruits with a taste that leaves your taste buds tingling long after you have eaten the meal.</p>', 'CONVENIENT, COST EFFECTIVE AND DELIVERED WITH CARE', '<p>The best food, from the best restaurants, with the best prices, delivered specially for you ensuring that you get the satisfaction of eating a gourmet meal in the comforts of your home or venue. No menu is difficult for us to prepare - just say the word and it will be delivered on-time, just for you.</p>', 'ENJOY THE DELIGHTS OF A DIGITALISED GLOBAL CUISINE APP', '<p>The digital world is moving so fast that you can now have a gourmet meal delivered to your doorstep using this phenomenal technology. No more in restaurants queues, spending hours browsing the menu or an hour before your first course gets to your table. Enchiladas, escargots, chicken vindaloo, pizza, tiramisu, Thai green curry with lemon scented rice, or just plain fish and chips, we have it all for you. What are you waiting for? Your mouth is already watering just reading those names - tap the app now!</p>', 'no-minimum-order1531119409.png', 'STEP 1 - SEARCH FOOD', '<p>Find your favorite foods from local restaurants at the same price.</p>', 'live-order-tracking1531119409.png', 'STEP 2 - PLACE ORDER', '<p>Order through our app or visit our website.</p>', 'lightning-fast-delivery1531119410.png', 'STEP 3- GET DELIVERY', '<p>EatCayman picks-ups and delivers right to your home or barracks.</p>', 'app-screen115311194101535701173.jpg', 'app-screen215311194101535701173.jpg', 'app-screen3153111941015357011731536005336.jpg', 'RESTAURANT IN YOUR POCKET', '<p>Tap the app, select your favorite restaurant and place the delicious food. That is what our app will do. No words are necessary when you place an order with us because we know exactly what you want.</p>', 'play-store1531119410.jpg', 'app-store1531119410.jpg', 'about-banner1531119410.jpg', 'Restaurant Partner?', 'Contact Us and Sign up Now', '<p>Click the button below to find out more.</p>\r\n\r\n<p><span><a href=\"#\">Find Out More</a></span></p>', 'MOST TRUSTED RESTAURANTS', 'Active'),
(2, 'FN', 'banner1531120623.jpg', 'LIVRAISON DE NOURRITURE', '√Ä LA DEMANDE', '<p>Satisfaire vos envies avec CubeFood avec une exp&eacute;rience culinaire qui bat tous les restaurants cinq &eacute;toiles<span><a href=\"about\">Lire la suite</a></span></p>', 'why-choose-img1531119409.png', 'POURQUOI NOUS CHOISIR', 'ALIMENTS FRAIS FABRIQU√âS AVEC DES INGR√âDIENTS HONN√äTES', '<p>Pour vous pr&eacute;senter des d&eacute;lices cr&eacute;atifs &eacute;quilibr&eacute;s sur le plan nutritionnel &Eacute;labor&eacute;s &agrave; partir des meilleurs ingr&eacute;dients, nos chefs cr&eacute;eront votre menu app&eacute;tissant, &eacute;quilibr&eacute; et savoureux, riche en fruits et en l&eacute;gumes, avec un go&ucirc;t qui laissera vos papilles picoter longtemps apr&egrave;s que vous aurez mang&eacute;. le repas.</p>', 'PRATIQUE, CO√õT EFFICACE ET LIVR√â AVEC SOIN', '<p>La meilleure nourriture, parmi les meilleurs restaurants, avec les meilleurs prix, livr&eacute;s sp&eacute;cialement pour vous assurer que vous avez la satisfaction de manger un repas gastronomique dans le confort de votre maison ou lieu. Aucun menu n&#39;est difficile pour nous de vous pr&eacute;parer - il suffit de dire le mot et il sera livr&eacute; &agrave; temps, juste pour vous.</p>', 'PROFITEZ DES D√âLICES D\'UNE APPLICATION DE CUISINE GLOBALE DIGITALIS√âE', '<p>Le monde num&eacute;rique &eacute;volue si vite que vous pouvez maintenant faire livrer un repas gastronomique &agrave; votre porte gr&acirc;ce &agrave; cette technologie ph&eacute;nom&eacute;nale. Plus besoin d&#39;attendre dans les files d&#39;attente des restaurants, de passer des heures &agrave; parcourir le menu ou une heure avant que votre premier cours arrive &agrave; votre table. Enchiladas, escargots, vindaloo au poulet, pizza, tiramisu, curry vert tha&iuml; au riz parfum&eacute; au citron, ou tout simplement fish and chips, nous avons tout pour vous. Qu&#39;est-ce que tu attends? Votre bouche est d&eacute;j&agrave; en train d&#39;arroser juste en lisant ces noms - appuyez sur l&#39;application maintenant!</p>', 'no-minimum-order1531119409.png', 'PAS DE COMMANDE MINIMUM', '<p>Commandez pour vous-m&ecirc;me ou pour le groupe, sans restriction sur la valeur de la commande</p>', 'live-order-tracking1531119409.png', 'SUIVI DES COMMANDES EN DIRECT', '<p>savoir o&ugrave; est votre commande en tout temps, du restaurant &agrave; votre porte</p>', 'lightning-fast-delivery1531119410.png', 'LIVRAISON LIGHTNING-FAST', '<p>D&eacute;couvrez notre livraison ultra-rapide, pour les aliments livr&eacute;s frais et &agrave; temps</p>', 'app-screen11531119410.jpg', 'app-screen21531119410.jpg', 'app-screen31531119410.jpg', 'RESTAURANT DANS VOTRE POCHE', '<p>Appuyez sur l&#39;application, s&eacute;lectionnez votre restaurant pr&eacute;f&eacute;r&eacute; et placez la nourriture d&eacute;licieuse. C&#39;est ce que notre application va faire. Aucun mot n&#39;est n&eacute;cessaire lorsque vous passez une commande avec nous, car nous savons exactement ce que vous voulez.</p>', 'play-store1531119410.jpg', 'app-store1531119410.jpg', 'about-banner1531119410.jpg', '√Ä PROPOS DE NOUS', 'Toute la gamme Eatery au bout des doigts', '<p>Quoi que vous aimiez, o&ugrave; que vous vouliez, nous avons toute la gamme de cuisines disponibles pour satisfaire votre faim. Choisissez le repas de votre choix, d&#39;un restaurant de votre choix, &agrave; la date et &agrave; l&#39;heure de votre choix et hop, vous vivrez une exp&eacute;rience culinaire cinq &eacute;toiles dans le confort de votre foyer, de votre bureau ou quel que soit l&#39;endroit o&ugrave; vous &ecirc;tes. Votre souhait est notre commande!</p>\r\n\r\n<p><span><a href=\"about\">Lire la suite</a></span></p>', 'MOST TRUSTED RESTAURANTS', 'Inactive'),
(13, 'ES', 'banner1531120623.jpg', 'ENTREGA DE COMIDA', 'BAJO DEMANDA', '<p>Satisface tus antojos con CubeFood con una experiencia culinaria que supera a cualquier restaurante de cinco estrellas<span><a href=\"about\">Lee mas</a></span></p>', 'why-choose-img1531119409.png', 'POR QU√â ELEGIRNOS', 'COMIDA FRESCA HECHO CON INGREDIENTES HONESTOS', '<p>Presentarle delicias deliciosas equilibradas nutricionalmente Hecho con los ingredientes m&aacute;s selectos, nuestros chefs crear&aacute;n su delicioso men&uacute; que es nutricionalmente equilibrado y sabroso, lleno de la bondad de las verduras y frutas con un sabor que deja su paladar hormigueo mucho despu&eacute;s de haber comido la comida.</p>', 'CONVENIENTE, COSTO EFECTIVO Y ENTREGADO CON CUIDADO', '<p>La mejor comida, de los mejores restaurantes, con los mejores precios, entregada especialmente para usted, que le garantiza la satisfacci&oacute;n de comer una comida gourmet en la comodidad de su hogar o lugar. No es dif&iacute;cil para nosotros preparar un men&uacute;: simplemente diga la palabra y se la entregar&aacute; a tiempo, solo para usted.</p>', 'DISFRUTA DE LAS DELICIAS DE UNA APLICACI√ìN GLOBAL DE LA GASTRONOM√çA DIGITALIZADA', '<p>El mundo digital se mueve tan r&aacute;pido que ahora puedes llevar una comida gourmet a tu puerta usando esta tecnolog&iacute;a fenomenal. Ya no tendr&aacute;s que esperar en las colas de los restaurantes, pasar horas explorando el men&uacute; o una hora antes de que tu primer curso llegue a tu mesa. Enchiladas, caracoles, pollo vindaloo, pizza, tiramis&uacute;, curry verde tailand&eacute;s con arroz con aroma de lim&oacute;n, o simplemente pescado con papas fritas, lo tenemos todo para usted. &iquest;Que estas esperando? Tu boca ya est&aacute; llorando solo leyendo esos nombres: &iexcl;toca la aplicaci&oacute;n ahora!</p>', 'no-minimum-order1531119409.png', 'SIN ORDEN M√çNIMA', '<p>Haga su pedido por usted o por el grupo, sin restricciones en el valor del pedido</p>', 'live-order-tracking1531119409.png', 'SEGUIMIENTO DE PEDIDO EN VIVO', '<p>saber d&oacute;nde est&aacute; su pedido en todo momento, desde el restaurante hasta su puerta</p>', 'lightning-fast-delivery1531119410.png', 'ENTREGA R√ÅPIDA Y R√ÅPIDA', '<p>Experimenta nuestra entrega s&uacute;per r&aacute;pida, para alimentos entregados frescos y a tiempo</p>', 'app-screen11531119410.jpg', 'app-screen21531119410.jpg', 'app-screen31531119410.jpg', 'RESTAURANTE EN TU BOLSILLO', '<p>Toque la aplicaci&oacute;n, seleccione su restaurante favorito y coloque la deliciosa comida. Eso es lo que har&aacute; nuestra aplicaci&oacute;n. No se necesitan palabras cuando realiza un pedido con nosotros porque sabemos exactamente lo que quiere.</p>', 'play-store1531119410.jpg', 'app-store1531119410.jpg', 'about-banner1531119410.jpg', 'SOBRE NOSOTROS', 'Toda la gama Eatery al alcance de su mano', '<p>Lo que sea que te apetezca, donde sea que te apetezca, tenemos toda la gama de cocinas disponibles para que puedas satisfacer tu apetito. Seleccione la comida de su elecci&oacute;n, de un restaurante de su elecci&oacute;n, en la fecha y hora de su elecci&oacute;n y listo, tendr&aacute; una experiencia culinaria de cinco estrellas en la comodidad de su hogar, oficina o donde sea que est&eacute;. &iexcl;Tus deseos son ordenes!</p>\r\n\r\n<p><span><a href=\"about\">Lee mas</a></span></p>', 'RESTAURANTES M√ÅS CONFIDENCIALES', 'Inactive');
INSERT INTO `home_content` (`id`, `vCode`, `header_first_label`, `header_second_label`, `home_banner_left_image`, `left_banner_txt`, `home_banner_right_image`, `right_banner_txt`, `third_sec_title`, `third_sec_desc`, `third_mid_image_one`, `third_mid_title_one`, `third_mid_desc_one`, `third_mid_image_two`, `third_mid_title_two`, `third_mid_desc_two`, `third_mid_image_three`, `third_mid_title_three`, `third_mid_desc_three`, `third_mid_image_one1`, `third_mid_title_one1`, `third_mid_desc_one1`, `third_mid_image_two1`, `third_mid_title_two1`, `third_mid_desc_two1`, `third_mid_image_three1`, `third_mid_title_three1`, `third_mid_desc_three1`, `mobile_app_bg_img`, `mobile_app_bg_img1`, `mobile_app_left_img`, `mobile_app_right_title`, `mobile_app_right_desc`, `taxi_app_bg_img`, `taxi_app_left_img`, `taxi_app_right_title`, `taxi_app_right_desc`, `driver_sec_first_label`, `driver_sec_second_label`, `eStatus`) VALUES
(1, 'EN', 'Your Favourite Delicacies Delivered To You', 'Have A Gourmet Meal On Us Today And Everyday', 'banner_left_EN.png', 'Fancy a Chinese today? Or Italian? Maybe Sushi? Or looking for diet meals? Are you pregnant and have a craving to eat a Stilton quiche? Or have guests for dinner at short notice? Just tap on the app and have that meal that you require.', 'home-img_EN.jpg', 'Satisfy your cravings with ABURGER  with a culinary experience that beats any five-star restaurants', 'The Entire Eatery Range At Your Fingertips', '<p>Whatever you fancy, wherever you fancy, we have the entire range of cuisines available just for you to satisfy your hunger. Select the meal of your choice, from an eatery of your choice, at the date and time of your choice and hey presto, you will a five-star culinary experience in the comfort of your home, office or wherever you are. Your wish is our command!</p>', 'home-box1_EN.jpg', 'Fresh Food Made With Honest Ingredients', '<h2>To Present You Nutritionally Balanced Luscious Delicacies</h2>\r\n\r\n<p>Made with the choicest of ingredients, our chefs will create your mouthwatering menu that is nutritionally balanced and tasty, full of the goodness of vegetables and fruits with a taste that leaves your taste buds tingling long after you have eaten the meal.</p>', 'home-box2_EN.jpg', 'Convenient, Cost Effective', '<h2>And Delivered With Care</h2>\r\n\r\n<p>The best food, from the best eateries, with the best prices, delivered specially for you ensuring that you get the satisfaction of eating a gourmet meal in the comforts of your home or venue. No menu is difficult for us to prepare &ndash; just say the word and it will be delivered on time, just for you.</p>', 'home-box3_EN.jpg', 'Enjoy The Delights Of A', '<h2>Digitalised Global Cuisine App</h2>\r\n\r\n<p>The digital world is moving so fast that you can now have a gourmet meal delivered to your doorstep using this phenomenal technology. No more waiting in restaurant queues, spending hours browsing the menu or an hour before your first course gets to your table. Enchiladas, escargots, chicken vindaloo, pizza, tiramisu, Thai green curry with lemon scented rice, or just plain fish and chips, we have it all for you. What are you waiting for? Your mouth is already watering just reading those names &ndash; tap the app now!</p>', '', 'No Minimum Order', '<p>Order in for yourself or for the group, with no restrictions on order value</p>', '', 'Live Order Tracking', '<p>know where your order is at all times,<br />\r\nfrom the restaurant to your doorstep</p>', '', 'Lightning-fast Delivery', '<p>Experience Swiggy&#39;s superfast delivery,<br />\r\nfor food delivered fresh &amp; on time</p>', 'mobile-app-bg_EN.jpg', '', 'mobile-img_EN.png', 'THAT PERFECTLY SYNCHRONISED RIDE JUST FOR YOU', '<p>Tap the app, select a driver, get to your destination without looking back. That is what our app will do. No words are necessary when you ride with us because we know exactly what you want. Ride and save with us &ndash; luxury cannot get any cheaper.</p>\r\n\r\n<p><span><a href=\"about-us\"><em>MORE INFO</em></a></span></p>', 'taxi-app-img-bg_EN.jpg', 'taxi-app-img_EN.jpg', 'A PERSONAL RIDE AT ALL TIMES', '<p>We are more than just a taxi system &ndash; a service that is at your beck and call at all times of the day or night, wherever you are in the world, professional services with a smile&nbsp; and no embarrassment during payment time &ndash; we give you the best ride whilst looking after your comfort and convenience</p>\r\n\r\n<p><span><a href=\"about-us\"><em>MORE INFO</em></a></span></p>', 'India\'s Most Trusted Restaurants', '', 'Active'),
(2, 'FN', 'Make your day', 'By Travelling in style to your destination', 'banner_left_FN.png', 'Driver Or company? The text to display in homepage after user login.', 'home-img_FN.jpg', 'The text to display in homepage after user login.', 'Tap, Ride, Tap ‚Äì That is all there is to it', '<p>The smart way of travelling, all with your smart phone and three little taps. Tap and look for your ride, Tap and book your ride and Tap and complete your ride. Your tap brings the driver to you for the best riding experience of your life, each one better than the previous one.</p>\r\n\r\n<p>No hassles of direction giving as your driver know exactly where you want to go. Payment completed via your credit card. Just sit back and enjoy your ride!</p>', 'home-box1_FN.jpg', 'Ever Ready, Anytime, Anywhere, Everyday', '<p>Wherever you want to go, irrespective of time, date and place, we are always ready. No waiting charges, no reservations, just our professionalism and courteous service.</p>\r\n\r\n<p>At your service 24/7, we take pride in what we do and it reflects in our driving. Building a relationship with clients that goes beyond professionalism.</p>', 'home-box2_FN.jpg', 'Luxury At Your Doorstep At Your Choice', '<p>Budgeted or luxury, we will have the ride of your choice. Go shopping in a mini and enjoy a limousine ride to your office party. Be spoilt for choice!</p>\r\n\r\n<p>Make your travelling experience a memorable one, we bring you the best on-demand cabbing experience. Pure comfort, luxury and style &ndash; the ultimate dream ride!</p>', 'home-box3_FN.jpg', 'Just For You, Just Like You', '<p>Ordinary people just like you and me are driving you places. Any city, big or small, any profession high paying or manual, whatever you do, wherever you are, can drive for us. From homemakers to students, from engineers to teachers, is all part of our driving family!</p>', '', '', '', '', '', '', '', '', '', 'mobile-app-bg_FN.jpg', '', 'mobile-img_FN.png', 'THAT PERFECTLY SYNCHRONISED RIDE JUST FOR YOU', '<p>Tap the app, select a driver, get to your destination without looking back. That is what our app will do. No words are necessary when you ride with us because we know exactly what you want. Ride and save with us &ndash; luxury cannot get any cheaper.</p>\r\n\r\n<p><span><a href=\"about-us\"><em>MORE INFO</em></a></span></p>', 'taxi-app-img-bg_FN.jpg', 'taxi-app-img_FN.jpg', 'A PERSONAL RIDE AT ALL TIMES', '<p>We are more than just a taxi system &ndash; a service that is at your beck and call at all times of the day or night, wherever you are in the world, professional services with a smile&nbsp; and no embarrassment during payment time &ndash; we give you the best ride whilst looking after your comfort and convenience</p>\r\n\r\n<p><span><a href=\"about-us\"><em>MORE INFO</em></a></span></p>', 'Meet Our Drivers', 'Our driving family welcomes you on board with a smile. Just look out for them!', 'Inactive'),
(13, 'ES', 'Make your day', 'By Travelling in style to your destination', 'banner_left_ES.png', 'Driver Or company? The text to display in homepage after user login.', 'home-img_ES.jpg', 'The text to display in homepage after user login.', 'Tap, Ride, Tap ‚Äì That is all there is to it', '<p>The smart way of travelling, all with your smart phone and three little taps. Tap and look for your ride, Tap and book your ride and Tap and complete your ride. Your tap brings the driver to you for the best riding experience of your life, each one better than the previous one.</p>\r\n\r\n<p>No hassles of direction giving as your driver know exactly where you want to go. Payment completed via your credit card. Just sit back and enjoy your ride!</p>', 'home-box1_ES.jpg', 'Ever Ready, Anytime, Anywhere, Everyday', '<p>Wherever you want to go, irrespective of time, date and place, we are always ready. No waiting charges, no reservations, just our professionalism and courteous service.</p>\r\n\r\n<p>At your service 24/7, we take pride in what we do and it reflects in our driving. Building a relationship with clients that goes beyond professionalism.</p>', 'home-box2_ES.jpg', 'Luxury At Your Doorstep At Your Choice', '<p>Budgeted or luxury, we will have the ride of your choice. Go shopping in a mini and enjoy a limousine ride to your office party. Be spoilt for choice!</p>\r\n\r\n<p>Make your travelling experience a memorable one, we bring you the best on-demand cabbing experience. Pure comfort, luxury and style &ndash; the ultimate dream ride!</p>', 'home-box3_ES.jpg', 'Just For You, Just Like You', '<p>Ordinary people just like you and me are driving you places. Any city, big or small, any profession high paying or manual, whatever you do, wherever you are, can drive for us. From homemakers to students, from engineers to teachers, is all part of our driving family!</p>', '', '', '', '', '', '', '', '', '', 'mobile-app-bg_ES.jpg', '', 'mobile-img_ES.png', 'THAT PERFECTLY SYNCHRONISED RIDE JUST FOR YOU', '<p>Tap the app, select a driver, get to your destination without looking back. That is what our app will do. No words are necessary when you ride with us because we know exactly what you want. Ride and save with us &ndash; luxury cannot get any cheaper.</p>\r\n\r\n<p><span><a href=\"about-us\"><em>MORE INFO</em></a></span></p>', 'taxi-app-img-bg_ES.jpg', 'taxi-app-img_ES.jpg', 'A PERSONAL RIDE AT ALL TIMES', '<p>We are more than just a taxi system &ndash; a service that is at your beck and call at all times of the day or night, wherever you are in the world, professional services with a smile&nbsp; and no embarrassment during payment time &ndash; we give you the best ride whilst looking after your comfort and convenience</p>\r\n\r\n<p><span><a href=\"about-us\"><em>MORE INFO</em></a></span></p>', 'Meet Our Drivers', 'Our driving family welcomes you on board with a smile. Just look out for them!', 'Inactive');
