(1, 'About Us', NULL, NULL, '', 'About Us', 'About Us', 'About Us', 'About Us', '<p>&nbsp;</p>\r\n\r\n<p><meta charset=\"utf-8\" /></p>\r\n\r\n<p dir=\"ltr\"><b id=\"docs-internal-guid-e9e19570-7fff-dc18-92a5-de625d9dfba1\">EatCayman</b><b>l is a food company that strives to be the best place to go when you&#39;re hungry, whether it&#39;s getting food delivered, or knowing the best places to visit. We do this by understanding our customers and the local cuisine while providing convenient food delivery, a place to help you decide, and ultimately value to everyone involved. </b></p>', '√Ä propos de nous', '', 'Active', 'Sobre nosotros', ''),
(2, 'Help Center', NULL, 'how-does-work-img2_20150113174354_20160601164108.jpg', '', 'Help Center', 'Help Center', 'Help Center', 'Help Center', '<p>email: techsupport@EatCayman</p>\r\n\r\n<p>contact number:&nbsp;</p>', 'Centre d‚Äôaide', '', 'Active', 'Centro de ayuda', ''),
