(4, 'Terms', 'Terms & Condition', '', '', 'Terms', 'Terms and Conditions', 'Terms', 'Terms', '<p><meta charset=\"utf-8\" /></p>\r\n\r\n<p align=\"center\"><big>EatCayman MERCHANT TERMS OF USE</big></p>\r\n\r\n<p><big>THESE &ldquo;TERMS OF USE&rdquo; WILL APPLY TO YOUR USE OF THE EatCayman SERVICES (THE &ldquo;SERVICES&rdquo;) AND YOUR RELATIONSHIP WITH VALUE UNLIMITED, INC. T/A EatCayman (&ldquo;EatCayman&rdquo;, &ldquo;US&rdquo; or &ldquo;WE&rdquo;). PLEASE READ THESE TERMS (THE &ldquo;TERMS&rdquo; OR &ldquo;MERCHANT TERMS&rdquo;) CAREFULLY. BY SIGNING THE EatCayman SIGN-UP SHEET, YOU OR THE ENTITY THAT YOU REPRESENT (&ldquo;MERCHANT&rdquo; OR &ldquo;YOU&rdquo;) AGREE TO BE BOUND BY THESE TERMS.</big></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<pre align=\"right\">\r\n<strong>EFFECTIVE: September 5, 2018 </strong></pre>\r\n\r\n<h3><strong>1. EatCayman Responsibilities.</strong>&nbsp;EatCayman will:</h3>\r\n\r\n<p>1.1. Display your logo and a listing of the Merchant stores that are identified on the Sign-Up Sheet or an appendix to the Sign-Up Sheet or otherwise confirmed by EatCayman in writing that are within the EatCayman coverage area (&quot;Merchant Stores&quot;);</p>\r\n\r\n<p>1.2. Display a menu of all food and beverage items sold at Merchant Stores (&quot;Merchant Products&quot;);</p>\r\n\r\n<p>1.3. Accept orders for Merchant Products through EatCayman&#39;s proprietary system (the &quot;EatCayman Service&quot; or the &quot;EatCayman Platform&quot;) from EatCayman customers (&quot;Orders&quot;); 1.4. Communicate with your designated representative for each Merchant Store about each Order;</p>\r\n\r\n<p>1.5. Forward each Order to a third-party delivery contractor (&quot;Driver&quot;), so that the Driver can pick up the applicable Merchant Product(s) from the Merchant Store to deliver to the EatCayman customer (&ldquo;Customer&quot;); and</p>\r\n\r\n<h3><strong>2. Merchant Responsibilities</strong>. Merchant will:</h3>\r\n\r\n<p>2.1. Provide EatCayman with electronic copies of the Merchant&#39;s take-out or delivery menu, including the price of each item on that menu, and notify EatCayman of any updates or changes to the Merchant&#39;s take-out or delivery menu within 3 business days from the date of change. Any updates or changes (including to prices) will take effect after 3 business days from the date of our receipt of your written notice of the change. (Any changes received after the close of our normal business hours will be deemed received on the following business day.) Merchant may not charge EatCayman Customers a higher price than the price listed for each menu item on its then-current menu. After sign-up Merchant is responsible for updating its menu via the EatCayman web portal;</p>\r\n\r\n<p>2.2. Accept all Orders placed through the EatCayman Services, as described on Merchant&#39;s then-current menu;</p>\r\n\r\n<p>2.3. Promptly confirm all Orders placed through the EatCayman Services in the manner prescribed by us;</p>\r\n\r\n<p>2.4. Prepare each Order for pickup by a Driver at the designated time, with all of the service items (i.e, utensils, napkins, etc) normally included in any delivery or take-out order by the Merchant; 16774561v1</p>\r\n\r\n<p>2.5. Process Orders in the same manner as other orders received in the Merchant Stores;</p>\r\n\r\n<p>2.6. Notify EatCayman of each Merchant Store&rsquo;s days and hours of operation and accept Orders through the EatCayman Services throughout those hours of operation. If a Merchant Stores days or hours of operation change, you must notify EatCayman at least 3 business days in advance. Merchant is responsible for updating hours of operation via the EatCayman web portal. If weather, casualty or other unforeseen circumstance requires you to modify the days or hours of operation of any Merchant Store, you will notify EatCayman at your earliest opportunity; and</p>\r\n\r\n<p>2.7. Notify all Merchant Store staff members of the relationship with EatCayman immediately upon execution of this Agreement.</p>\r\n\r\n<h3><strong>3. Refunds and Re-Orders.</strong>&nbsp;If EatCayman has to submit a re-order on a Customer&#39;s Order,</h3>\r\n\r\n<p>Merchant will prepare the Order to the same specifications as the original Order at its expense.</p>\r\n\r\n<h3><strong>4. Discontinuation of Merchant Products or Services.</strong></h3>\r\n\r\n<p>If we determine, in our reasonable &nbsp;&nbsp;determination, that continuing to support Orders of a particular Merchant Product or Merchant Store could subject EatCayman to undue regulatory risk or other liability, or subject Drivers to threats to their safety or property, we may remove such Merchant Product and/or Merchant Store from the EatCayman Services without notice to you.</p>\r\n\r\n<h3><strong>5. Order Equipment.</strong></h3>\r\n\r\n<p>Merchant will install and utilize any equipment reasonably required by EatCayman for Merchant to receive Orders (including, without limitation, a tablet, fax machine, or other automated, electronic means of receiving Orders) (&quot;Order Equipment&quot;). Any Order Equipment provided by EatCayman will remain our sole property and may be used solely in connection with the Services. You will be responsible for any damage to or loss of any Order Equipment provided by EatCayman , the replacement cost of which may be deducted by EatCayman from amounts remitted to you for Orders.</p>\r\n\r\n<h3><strong>6. Payment, Fees, and Taxes.</strong></h3>\r\n\r\n<p>EatCayman will remit the menu price (plus tax) of Orders filled by Merchant each week as described on the Sign-Up Sheet, provided that EatCayman shall be entitled to deduct from such payment the &ldquo;Fees Paid by You&rdquo; as detailed in the Sign-Up Sheet. If Merchant has opted for a tablet subscription, EatCayman will also deduct a weekly fee, as set forth on the Sign-Up Sheet. EatCayman retain the right to charge any Customer additional fees (e.g., a delivery fee, service fee, or an additional markup for Merchant Products). Merchant shall be responsible for all taxes, duties, and other governmental charges on the sale of Products under this Agreement and remitting such taxes, duties, and other governmental charges to the appropriate authorities.</p>\r\n\r\n<h3><strong>7. Payment Processing.</strong></h3>\r\n\r\n<p>Payment processing services for Merchants are provided by Stripe and are subject to the Stripe Terms of Service (collectively, the &quot;Stripe Services Agreement&quot;). By agreeing to these Terms, you agree to be bound by the Stripe Services Agreement, as it may be modified by Stripe from time to time. As a condition of EatCayman enabling payment processing services through Stripe, you agree to provide EatCayman accurate and complete information about you and your business, 16774561v1 and you authorize EatCayman to share it and transaction information related to your use of the payment processing services provided by Stripe.</p>\r\n\r\n<h3><strong>8. Merchant Content and Trademark. </strong></h3>\r\n\r\n<p>During the Term, Merchant grants to EatCayman a royalty-free, non-exclusive, limited, revocable, non-transferable, non- sublicenseable right and license to use the content provided by Merchant to EatCayman , including without limitation, menus, photographs, trademarks, and logos for EatCayman to use in providing services to Merchant.</p>\r\n\r\n<h3><strong>9. Termination.</strong></h3>\r\n\r\n<p>Either party may terminate this Agreement for any reason at any time upon written notice. Neither Merchant nor EatCayman will be required to pay any fee in connection with a termination by either party or be liable to the other as a result of termination of this Agreement for any damages, for the loss of goodwill, prospective profits or anticipated income, or on account of any expenditures, investments, leases or commitments made by either Merchant or EatCayman.</p>\r\n\r\n<h3><strong>10. Modifications of These Terms.</strong></h3>\r\n\r\n<p>EatCayman reserves the right, to change, suspend, or discontinue the Services (including without limitation, the availability of any feature or content) at any time, for any reason. We may revise these Terms from time to time. The changes will not be retroactive, and the most current version of the terms will be at #. We will notify you of material revisions via a service notification or an email to the email associated with your account. By continuing to access or use the Services after those revisions become effective, you agree to be bound by the revised Terms.</p>\r\n\r\n<h3><strong>11. Representations and Warranties.</strong></h3>\r\n\r\n<p>11.1. Each party represents and warrants that it has the full right, power, and authority to enter into and perform its obligations under this Agreement without breaching any obligation to any third party.</p>\r\n\r\n<p>11.2. THE SERVICES, AND ANY EQUIPMENT ARE PROVIDED &quot;AS IS&quot; AND WITHOUT WARRANTY OF ANY KIND, AND EACH PARTY HEREBY DISCLAIMS ANY AND ALL EXPRESS, IMPLIED, OR STATUTORY WARRANTIES. Merchant acknowledges that the operation of the Services may from time to time encounter technical or other problems and may not necessarily continue uninterrupted or without technical or other errors and EatCayman shall not be responsible to Merchant or others for any such interruptions, errors, or problems or an outright discontinuance of the Services.</p>\r\n\r\n<p>11.3. MERCHANT REPRESENTS AND WARRANTS THAT TO THE BEST OF ITS KNOWLEDGE, THE OPERATION OF ITS BUSINESS AND PREPARATION AND SALE OF FOOD AND BEVERAGE ITEMS WILL AT ALL TIMES COMPLY WITH ALL APPLICABLE LAWS, RULES, STANDARDS AND REGULATIONS, INCLUDING THOSE RELATING TO REGULATORY PERMITS AND LICENSES, FOOD SAFETY, AND SANITATION.</p>\r\n\r\n<p>11.4. Both Parties acknowledge that neither party has received any assurances for future business or that any investment by a party will be recovered or recouped or that such party will obtain any anticipated amount of profits by virtue of this Agreement. Neither Party will be responsible to the other Party for any expectation of revenue or profit related to the Services.</p>\r\n\r\n<h3><strong>12.Indemnification.</strong></h3>\r\n\r\n<p>Each party (the &quot;Indemnifying Party&quot;) will defend, indemnify, pay, and hold harmless the other party, its subsidiaries and affiliates, and their respective officers, directors, shareholders, employees, and agents (the &quot;Indemnified Party&quot;) from and against any third-party claims arising from: (i) any bodily injury (including death) or damage to tangible or real property to the extent caused by the Indemnifying Party&#39;s personnel (or, in the case of Merchant as the Indemnifying Party, caused by the Merchant Products); or (ii) the violation of the intellectual property of a third party by the Indemnifying Party&#39;s Materials; provided that in each case the Indemnified Party provides the Indemnifying Party with (a) prompt notice of any claims, (b) the option to assume sole control over defense and settlement of any claim, and (c) reasonable assistance in connection with such defense and settlement (at the Indemnifying Party&#39;s expense).</p>\r\n\r\n<h3><strong>13.Limitation of Liability.</strong></h3>\r\n\r\n<p>Except with respect to amounts payable to third parties under Section 11, (i) neither party will be liable to the other under this Agreement, for indirect, special, punitive or consequential damages, and (ii) each party&#39;s maximum aggregate liabilities related to or in connection with this Agreement shall not exceed [$2,000]; provided, however that this limitation shall not apply to any liability related to intellectual property infringement.</p>\r\n\r\n<h3><strong>14.General Provisions</strong>.</h3>\r\n\r\n<p>Nothing in these Terms is to be construed as creating an agency, partnership, joint venture or franchise relationship between EatCayman and Merchant, and except as expressly set forth herein, each party shall be responsible for its own costs of performance hereunder. As set forth on the Sign-Up Sheet executed between Merchant and EatCayman, these Terms form part of an Agreement between the parties, which supersedes all prior agreements and communications of the parties, oral or written, with respect to the subject matter hereof. Except as set forth herein, no amendment to, or waiver of, any provision of this Agreement will be effective unless in writing and signed by both parties. The waiver by any party of any breach or default will not constitute a waiver of any different or subsequent breach or default. This Agreement is governed by and interpreted in accordance with the laws of the [Commonwealth of Virginia] without regard to the conflicts of laws principles thereof. The parties hereby consent to exclusive jurisdiction in the courts of [Norfolk, Virginia]. Merchant may not assign this Agreement in whole or in part without EatCayman&#39;s prior written consent. EatCayman may freely assign this Agreement. This Agreement will be binding upon, and inure to the benefit of, the permitted successors and assigns of each party, but shall not confer any rights or remedies upon any other third party. All notices, requests, consents and other communications hereunder must be in writing, and delivered by overnight courier to the addresses set forth on the Sign- Up Sheet (or any updated address properly noticed hereunder). If any provision of this Agreement is held to be invalid, illegal or unenforceable for any reason, such invalidity, illegality or unenforceability will not affect any other provisions of this Agreement, and this Agreement will be construed as if such invalid, illegal or unenforceable provision had never been contained here.</p>', 'Termes et conditions', '', 'Active', 'T√©rminos & Condiciones', ''),
(6, 'How It Works', 'How It Works', 'how-it-work-img_20160311133021.png', '', 'How It Works', 'How It Works', 'How It Works', 'How It Works', '<h2><strong>STEP 1</strong></h2>\r\n\r\n<p><strong>Search Food </strong>Find your food on the app or website EatCayman.net</p>\r\n\r\n<h2><strong>STEP 2</strong></h2>\r\n\r\n<p><strong>Place Order </strong>Order your favorite foods from local restaurants, same menu prices.</p>\r\n\r\n<h2><strong>STEP 3</strong></h2>\r\n\r\n<p><strong></strong> EatCayman delivers right to your home, office or barracks.</p>', 'Comment √ßa marche', '', 'Active', 'C√≥mo funciona', ''),
(7, 'Trust Safety & Insurance', 'Trust Safety & Insurance', 'trust-safety-div-img_20160311132932.jpg', '', 'Trust Safety & Insurance', 'Trust Safety & Insurance', 'Trust Safety & Insurance', 'Trust Safety & Insurance', '<div>\r\n<div>\r\n<h3>Please <a href=\"#\">contact us</a> for details.</h3>\r\n\r\n<div>\r\n<div>\r\n<div>\r\n<h1>&nbsp;</h1>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', 'Fiducie s√ªret√© & assurance', '', 'Active', 'Confianza seguridad y seguro', ''),
(22, '404-ERROR', NULL, '1_1456240109_29588_20160315163550.jpg', '', 'Page-Not-Found', 'Page-Not-Found', 'Page-Not-Found', '404-ERROR', '<h1>Oops!</h1>\r\n\r\n<p>We can&#39;t seem to find the page you&#39;re looking for.</p>', 'Wooops... 404', '', 'Active', 'ERROR 404', ''),
(33, 'Customer Privacy and Terms', NULL, '1_1456240109_29588_20160315163550_20170703181057.jpg', '', 'Customer Privacy and Terms', 'Customer Privacy and Terms', 'Customer Privacy and Terms', 'Customer Privacy and Terms', '<p><meta charset=\"utf-8\" /><b id=\"docs-internal-guid-bd18ba5b-7fff-b126-7cfd-dd00ac31586d\">At EatCayman, we are concerned about privacy issues and want you to be familiar with how we collect, use, and disclose Personal Information (as defined below). This Privacy Policy describes our practices in connection with privacy and also describes the Personal Information we collect through our website and mobile applications now or in the future that reference this Privacy Policy (collectively, the &quot;Sites&quot;). Except as indicated below, this Privacy Policy does not address the collection, use, or disclosure of information by us or by third parties on any websites or mobile applications other than the Sites. As used in this Privacy Policy, &quot;EatCayman,&quot; &quot;we,&quot; &quot;us,&quot; and &quot;our&quot; means EatCayman and its and affiliates.</b></p>\r\n\r\n<p dir=\"ltr\"><b id=\"docs-internal-guid-bd18ba5b-7fff-b126-7cfd-dd00ac31586d\">By accessing and/or using the Sites, you agree to all the terms and conditions of this Privacy Policy and our Terms of Use, available at <a href=\"#\">#/terms</a>. If you do not agree to all the terms and conditions of this Privacy Policy, do not use the Sites.</b></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p dir=\"ltr\"><b id=\"docs-internal-guid-bd18ba5b-7fff-b126-7cfd-dd00ac31586d\">1. What Types of Information Do We and Our Third Party Service Providers Collect from You and in What Circumstances Do We Collect It?</b></p>\r\n\r\n<p dir=\"ltr\"><b id=\"docs-internal-guid-bd18ba5b-7fff-b126-7cfd-dd00ac31586d\">We, and our third party service providers who perform services on our behalf, collect information in a variety of circumstances when you visit and use our Sites.</b></p>\r\n\r\n<p dir=\"ltr\"><b id=\"docs-internal-guid-bd18ba5b-7fff-b126-7cfd-dd00ac31586d\">For example, we may collect information:</b></p>\r\n\r\n<ul>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\"><b id=\"docs-internal-guid-bd18ba5b-7fff-b126-7cfd-dd00ac31586d\">when you register for our service, sign up for our mailing list, enter a contest or sweepstakes or communicate with us;</b></p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\"><b id=\"docs-internal-guid-bd18ba5b-7fff-b126-7cfd-dd00ac31586d\">when you use and interact with our Sites and service, such as when you place an order, post a review, or interact with other users or with restaurants on the Sites;</b></p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\"><b id=\"docs-internal-guid-bd18ba5b-7fff-b126-7cfd-dd00ac31586d\">when you make a payment for services;</b></p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\"><b id=\"docs-internal-guid-bd18ba5b-7fff-b126-7cfd-dd00ac31586d\">if you log in through a social network or authentication service, such as Facebook or Google, these services will authenticate your identity and may provide you the option to share Personal Information (such as your name, email address, address book and contacts, or other information) with us; and</b></p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\"><b id=\"docs-internal-guid-bd18ba5b-7fff-b126-7cfd-dd00ac31586d\">if you give permission for the Sites to access your address book or camera roll on your device, for example, to send an invitation to a friend or to upload a photo to the Sites.</b></p>\r\n	</li>\r\n</ul>\r\n\r\n<p dir=\"ltr\"><b id=\"docs-internal-guid-bd18ba5b-7fff-b126-7cfd-dd00ac31586d\">The information we collect includes Personal Information that can uniquely identify you (whether alone or in combination with other data or information), such as your name, postal address, telephone number, email address, date of birth, or similar data. Personal Information also includes certain sensitive information related to your finances or, for business accounts, related to the finances of your employer, such as a credit card number or other payment account number (including the three [3] or four [4] digit validation code for your credit card). In order for you to take advantage of the services provided through the Sites, we may require that you furnish Personal Information or, for certain business accounts, that your employer furnish Personal Information for you. We may also collect non-personal information from you, including information about your use of our Sites, but when such non-personal information is linked to your Personal Information, we will treat it as Personal Information. We may also receive information about you from third party sources, such as other users of our Sites, drivers, merchants, and other partners.</b></p>\r\n\r\n<p dir=\"ltr\"><b id=\"docs-internal-guid-bd18ba5b-7fff-b126-7cfd-dd00ac31586d\">Information collected automatically when you visit or use our Sites. We and our third party service providers may collect certain types of usage information when you visit our Sites, read our emails, or otherwise engage with us. We may use this information to enhance and personalize your user experience, to monitor and improve our websites and services, and for other similar purposes. In some instances, we and our third party service providers may combine this usage information with Personal Information. If we do combine any usage information with Personal Information, the combined information will be treated by us as Personal Information hereunder (as long as it is so combined).</b></p>\r\n\r\n<p dir=\"ltr\"><b id=\"docs-internal-guid-bd18ba5b-7fff-b126-7cfd-dd00ac31586d\">We and our third party partners use tracking technologies, including cookies, web beacons, embedded scripts, location-identifying technologies, file information, and similar technology, to automatically collect usage and device information, such as:</b></p>\r\n\r\n<ul>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\"><b id=\"docs-internal-guid-bd18ba5b-7fff-b126-7cfd-dd00ac31586d\">Information about your device and its software, including your IP address, browser type, Internet service provider, device type/model/manufacturer, operating system, date and time stamp, and a unique ID that allows us to identify your browser, mobile device, or your account (including, for example, a persistent device identifier or an Ad ID), and other similar information. We may also work with third party partners to employ technologies, including the application of statistical modeling tools, that permit us to recognize and contact you across multiple devices.</b></p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\"><b id=\"docs-internal-guid-bd18ba5b-7fff-b126-7cfd-dd00ac31586d\">Information about the way you access and use our Sites, for example, the site from which you came and the site to which you are going when you leave our Sites, the pages you visit, the links you click, whether you open emails or click the links contained in emails, whether you access the Sites from multiple devices, and other actions you take on the Sites.</b></p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\"><b id=\"docs-internal-guid-bd18ba5b-7fff-b126-7cfd-dd00ac31586d\">Analytics information. We may collect analytics data or use third party analytics tools such as Google Analytics to help us measure traffic and usage trends for the Sites and to understand more about the demographics of our users. You can learn more about Google&#39;s practices at <a href=\"http://www.google.com/policies/privacy/partners\">http://www.google.com/policies/privacy/partners</a>.</b></p>\r\n	</li>\r\n</ul>\r\n\r\n<p dir=\"ltr\"><b id=\"docs-internal-guid-bd18ba5b-7fff-b126-7cfd-dd00ac31586d\">If you would prefer not to accept cookies, most browsers will allow you to: (i) change your browser settings to notify you when you receive a cookie, which lets you choose whether or not to accept it; (ii) disable existing cookies; or (iii) set your browser to automatically reject cookies; however, doing so may negatively impact your experience using the Sites, as some features and services on our Sites may not work properly. You may also set your email options to prevent the automatic downloading of images that may contain technologies that would allow us to know whether you have accessed our email and performed certain functions with it. See Section 4 below to learn more about our online advertising practices.</b></p>\r\n\r\n<p dir=\"ltr\"><b id=\"docs-internal-guid-bd18ba5b-7fff-b126-7cfd-dd00ac31586d\">How We Respond to Do Not Track Signals. Although we do our best to honor the privacy preferences of our users, we are currently unable to respond to Do Not Track signals set by your browser.</b></p>\r\n\r\n<p dir=\"ltr\"><b id=\"docs-internal-guid-bd18ba5b-7fff-b126-7cfd-dd00ac31586d\">Location Information. With your consent, we may obtain information about your physical location through geolocation features on your device, including GPS (e.g. latitude and/or longitude). We may use this information to improve order efficiency and enhance your user experience. We may also infer your location based on other information we collect. For example, your IP Address indicates the general geographic region from which you are connecting to the Internet.</b></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p dir=\"ltr\"><b id=\"docs-internal-guid-bd18ba5b-7fff-b126-7cfd-dd00ac31586d\">2. How Do We and Our Third Party Service Providers Use Information Collected from You?</b></p>\r\n\r\n<p dir=\"ltr\"><b id=\"docs-internal-guid-bd18ba5b-7fff-b126-7cfd-dd00ac31586d\">We and our third party service providers may use Personal Information:</b></p>\r\n\r\n<ul>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\"><b id=\"docs-internal-guid-bd18ba5b-7fff-b126-7cfd-dd00ac31586d\">to process your registration on our Sites, including verifying your information to ensure its accuracy and validity.</b></p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\"><b id=\"docs-internal-guid-bd18ba5b-7fff-b126-7cfd-dd00ac31586d\">to fulfill your requests (e.g., to allow you to order food through our restaurant partners and have it delivered to you, or to provide you with information that you request).</b></p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\"><b id=\"docs-internal-guid-bd18ba5b-7fff-b126-7cfd-dd00ac31586d\">to fulfill your purchases (e.g., to process credit card payments in connection with your food order).</b></p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\"><b id=\"docs-internal-guid-bd18ba5b-7fff-b126-7cfd-dd00ac31586d\">to customize content on our Sites (e.g., the restaurants that will deliver to your location).</b></p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\"><b id=\"docs-internal-guid-bd18ba5b-7fff-b126-7cfd-dd00ac31586d\">to send you important information regarding the Sites, such as certain changes to our terms, conditions, policies, and/or other administrative information. Because this information may be material to your use of the Sites, you may not opt out of receiving such communications.</b></p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\"><b id=\"docs-internal-guid-bd18ba5b-7fff-b126-7cfd-dd00ac31586d\">to inform you of products, programs, services, and promotions that we believe may be of interest to you, including, without limitation, adding you to our mailing lists and sending you emails or push-notifications from time to time, and permitting you to participate in sweepstakes, contests, and similar promotions (collectively, &quot;Promotions&quot;).</b></p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\"><b id=\"docs-internal-guid-bd18ba5b-7fff-b126-7cfd-dd00ac31586d\">to evaluate your eligibility for certain types of Promotions, offers, products, or services that may be of interest to you.</b></p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\"><b id=\"docs-internal-guid-bd18ba5b-7fff-b126-7cfd-dd00ac31586d\">to permit you to refer us to your friends so that we may send them a promotional offer through the Sites. If you wish to use this feature, you may be required to provide us with, and we may use, your friend&#39;s name, email address, and other information you share with us. By using this functionality, you affirm that you are entitled to use and provide us with your friend&#39;s name and email address for this purpose. We will not use your friend&#39;s Personal Information for any purpose other than to allow a promotional offer to be sent and/or to troubleshoot any issues with respect to such promotional offer, unless we disclose such other purpose to you at the time you provide your friend&#39;s Personal Information to us.</b></p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\"><b id=\"docs-internal-guid-bd18ba5b-7fff-b126-7cfd-dd00ac31586d\">to perform analytics and conduct customer research.</b></p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\"><b id=\"docs-internal-guid-bd18ba5b-7fff-b126-7cfd-dd00ac31586d\">for our internal business purposes, such as data analysis, audits, fraud prevention, developing new products and/or features, enhancing the Sites, improving our services, identifying usage trends, and determining the effectiveness of our promotional campaigns.</b></p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\"><b id=\"docs-internal-guid-bd18ba5b-7fff-b126-7cfd-dd00ac31586d\">to enforce our corporate reporting obligations and our Terms of Use, or to comply with applicable laws.</b></p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\"><b id=\"docs-internal-guid-bd18ba5b-7fff-b126-7cfd-dd00ac31586d\">for purposes disclosed at the time you provide your Personal Information or as otherwise set forth in this Privacy Policy.</b></p>\r\n	</li>\r\n</ul>\r\n\r\n<p dir=\"ltr\"><b id=\"docs-internal-guid-bd18ba5b-7fff-b126-7cfd-dd00ac31586d\">We and our third party service providers may also use aggregate Personal Information in a manner such that the end-product does not uniquely identify you or any other user of the Sites. For example, we may use Personal Information to calculate the percentage of our users who have a particular telephone area code.</b></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p dir=\"ltr\"><b id=\"docs-internal-guid-bd18ba5b-7fff-b126-7cfd-dd00ac31586d\">3. How Do We and Our Third Party Service Providers Share Your Personal Information with Others?</b></p>\r\n\r\n<p dir=\"ltr\"><b id=\"docs-internal-guid-bd18ba5b-7fff-b126-7cfd-dd00ac31586d\">We and our third party service providers may disclose Personal Information:</b></p>\r\n\r\n<ul>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\"><b id=\"docs-internal-guid-bd18ba5b-7fff-b126-7cfd-dd00ac31586d\">to our affiliates, including Seamless Europe, Ltd., so that they also may use such Personal Information for the purposes described in this Privacy Policy. EatCayman is the party responsible for the management of the jointly-used Personal Information.</b></p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\"><b id=\"docs-internal-guid-bd18ba5b-7fff-b126-7cfd-dd00ac31586d\">to our third party service providers that provide services on our behalf, such as payment processing, website hosting, data analysis, infrastructure provisioning, IT services, customer service, email delivery services, targeted advertising and marketing, and other similar services.</b></p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\"><b id=\"docs-internal-guid-bd18ba5b-7fff-b126-7cfd-dd00ac31586d\">to third parties such as attorneys, collection agencies, tribunals or law enforcement authorities pursuant to valid requests in connection with alleged violations of our Terms of Use or other alleged contract violations, actual or alleged infringement, actual or suspected harm to persons or property, or alleged violations of laws, rules, or regulations.</b></p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\"><b id=\"docs-internal-guid-bd18ba5b-7fff-b126-7cfd-dd00ac31586d\">to third parties as needed to detect, prevent, or otherwise address actual or suspected fraud, harassment, security or technical issues, violations of any law, rule, regulation or the policies of the Sites, and to verify your purchase to holder(s) of any credit card(s) or other payment account(s) used to place order(s) using your account or your information.</b></p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\"><b id=\"docs-internal-guid-bd18ba5b-7fff-b126-7cfd-dd00ac31586d\">as required to fulfill your order (e.g., to our restaurant partners to enable them to fulfill your order).</b></p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\"><b id=\"docs-internal-guid-bd18ba5b-7fff-b126-7cfd-dd00ac31586d\">to restaurants and brands from which you have placed orders through the Sites as well as their affiliates and third party service providers. These restaurants, brands, and their affiliates, may use your information as permitted by their own privacy policies, which could include sending you marketing communications and other promotional content.</b></p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\"><b id=\"docs-internal-guid-bd18ba5b-7fff-b126-7cfd-dd00ac31586d\">to identify you to any person with whom you interact through the Sites.</b></p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\"><b id=\"docs-internal-guid-bd18ba5b-7fff-b126-7cfd-dd00ac31586d\">to third party sponsors of Promotions (irrespective of whether such Promotions are hosted by us), or otherwise in accordance with the rules applicable to such Promotions. You should carefully review the rules, if any, of each Promotion in which you participate, as they may contain additional important information about our, a sponsor&#39;s, and/or other third parties&#39; use of your Personal Information. To the extent that the rules of those Promotions concerning the treatment of your Personal Information conflict with this Privacy Policy, the rules of those Promotions shall control.</b></p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\"><b id=\"docs-internal-guid-bd18ba5b-7fff-b126-7cfd-dd00ac31586d\">to third party partners in connection with integration, co-marketing and certain other coordinated efforts.</b></p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\"><b id=\"docs-internal-guid-bd18ba5b-7fff-b126-7cfd-dd00ac31586d\">to an affiliate or other third party in connection with a reorganization, merger, sale, joint venture, assignment, transfer, or other disposition of all or any portion of our business, assets, or stock (including without limitation in connection with any bankruptcy and/or similar proceedings).</b></p>\r\n	</li>\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\"><b id=\"docs-internal-guid-bd18ba5b-7fff-b126-7cfd-dd00ac31586d\">as we believe to be appropriate: (a) under applicable law, including laws outside your country of residence; (b) to comply with legal process; (c) to respond to requests from public and government authorities, including public and government authorities outside your country of residence; (d) to enforce our terms and conditions; (e) to protect our operations and/or those of any of our affiliates; (f) to protect our rights, privacy, safety, and/or property, and/or that of our affiliates, you, and/or others; (g) to permit us to pursue available remedies and/or limit the damages that we may sustain; and (h) for recordkeeping purposes.</b></p>\r\n	</li>\r\n</ul>\r\n\r\n<p dir=\"ltr\"><b id=\"docs-internal-guid-bd18ba5b-7fff-b126-7cfd-dd00ac31586d\">We may also share Personal Information which has been aggregated or de-identified in a manner such that the end-product does not uniquely identify you or any other user of the Sites.</b></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p dir=\"ltr\"><b id=\"docs-internal-guid-bd18ba5b-7fff-b126-7cfd-dd00ac31586d\">4. Third Party Tracking and Online Advertising.</b></p>\r\n\r\n<p dir=\"ltr\"><b id=\"docs-internal-guid-bd18ba5b-7fff-b126-7cfd-dd00ac31586d\">We participate in interest-based advertising and use third party advertising companies to serve you targeted advertisements based on your online browsing history and your interests. We permit third party online advertising networks, social media companies, and other third party services to collect information about your use of our Sites over time so that they may play or display ads on our Sites, on other websites, apps, or services you may use, and on other devices you may use. Typically, though not always, the information used for interest-based advertising is collected through cookies or similar tracking technologies. We may share a common account identifier (such as an email address or user ID) or hashed data with our third party advertising partners to help identify you across devices. We and our third party partners use this information to make the advertisements you see online more relevant to your interests, as well as to provide advertising-related services such as reporting, attribution, analytics, and market research.</b></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p dir=\"ltr\"><b id=\"docs-internal-guid-bd18ba5b-7fff-b126-7cfd-dd00ac31586d\">To learn more about interest-based advertising and how you may be able to opt-out of some of this advertising, you may wish to visit the Network Advertising Initiative&#39;s (&quot;NAI&quot;) online resources, available at <a href=\"http://www.networkadvertising.org/choices\">http://www.networkadvertising.org/choices</a>, and/or the Digital Advertising Alliance&#39;s (&quot;DAA&quot;) resources, available at <a href=\"http://www.aboutads.info/choices\">http://www.aboutads.info/choices</a>. You may also be able to set your browser to delete or notify you of cookies by actively managing the settings on your browser or mobile device. Please note, however, that some advertising opt-outs may not be effective unless your browser is set to accept cookies. Furthermore, if you use a different device, change browsers, or delete the opt-out cookies, you may need to perform the opt-out task again.</b></p>\r\n\r\n<p dir=\"ltr\"><b id=\"docs-internal-guid-bd18ba5b-7fff-b126-7cfd-dd00ac31586d\">You may also be able to limit certain interest-based mobile advertising through the settings on your mobile device by selecting &quot;limit ad tracking&quot; (iOS) or &quot;opt out of interest-based ads&quot; (Android).</b></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p dir=\"ltr\"><b id=\"docs-internal-guid-bd18ba5b-7fff-b126-7cfd-dd00ac31586d\">Google Analytics and Advertising. We may also utilize certain forms of display advertising and other advanced features through Google Analytics, such as Remarketing with Google Analytics, Google Display Network Impression Reporting, and Google Analytics Demographics and Interest Reporting. These features enable us to use first-party cookies (such as the Google Analytics cookie) and third party cookies (such as the DoubleClick advertising cookie) or other third party cookies together to inform, optimize, and display ads based on your past visits to the Sites. You may control your advertising preferences or opt out of certain Google advertising products by visiting the Google Ads Preferences Manager, currently available at <a href=\"https://google.com/ads/preferences%2520\">https://google.com/ads/preferences</a>, or by visiting NAI&#39;s online resources at <a href=\"http://www.networkadvertising.org/choices\">http://www.networkadvertising.org/choices</a>.</b></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p dir=\"ltr\"><b id=\"docs-internal-guid-bd18ba5b-7fff-b126-7cfd-dd00ac31586d\">5. Profiles and Interactive Areas.</b></p>\r\n\r\n<p dir=\"ltr\"><b id=\"docs-internal-guid-bd18ba5b-7fff-b126-7cfd-dd00ac31586d\">We and our third party service providers may make available through the Sites certain features and services (for example, ratings and reviews, photo uploads, and chat functionality) to which you may be able to post information and materials. Please note that any information you provide in connection with such services may become public, and may be available to visitors to the Sites and to the general public, including without limitation the ratings, reviews, and photographs that accompany many restaurant listings. We urge you to exercise discretion and caution when deciding to disclose your Personal Information, and/or any other information and/or materials, on the Sites. NEITHER WE, NOR ANY OF OUR THIRD PARTY SERVICE PROVIDERS, NOR ANY OTHER PERSON OR ENTITY DULY AUTHORIZED BY US AND/OR BY OUR THIRD PARTY SERVICE PROVIDERS, IS OR SHALL BE RESPONSIBLE FOR ANY USE BY ANY UNAUTHORIZED PERSON OR ENTITY OF ANY PERSONAL INFORMATION YOU DISCLOSE IN THE MANNER DESCRIBED IN THIS SECTION 5 THROUGH THE SITES.</b></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p dir=\"ltr\"><b id=\"docs-internal-guid-bd18ba5b-7fff-b126-7cfd-dd00ac31586d\">6. Third Party Sites.</b></p>\r\n\r\n<p dir=\"ltr\"><b id=\"docs-internal-guid-bd18ba5b-7fff-b126-7cfd-dd00ac31586d\">Except as expressly set forth herein, this Privacy Policy does not address, and neither we nor our third party service providers is responsible for, the privacy, information, or other practices of other websites and/or any third parties, including without limitation any of our affiliates and/or any third party operating any site to which the Sites contain a link. For clarity, the inclusion of a link to a third party website on the Sites does not imply endorsement of the linked site by us or by our affiliates. Please note that your access and/or use of any third party websites, including your provision of any information, materials and/or other content to such sites, is entirely at your own risk. We encourage you to read the policies and terms of every website you visit.</b></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p dir=\"ltr\"><b id=\"docs-internal-guid-bd18ba5b-7fff-b126-7cfd-dd00ac31586d\">7. Security.</b></p>\r\n\r\n<p dir=\"ltr\"><b id=\"docs-internal-guid-bd18ba5b-7fff-b126-7cfd-dd00ac31586d\">We and our third party service providers use reasonable organizational, technical, and administrative measures designed to protect Personal Information under our control. However, no data transmission over the Internet or data storage system can be guaranteed to be 100% secure. If you have reason to believe that your interaction with us is not secure (for example, if you feel that the security of any account you might have with us has been compromised), you must immediately notify us of the problem by contacting us in accordance with the &quot;Contacting Us&quot; section below.</b></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p dir=\"ltr\"><b id=\"docs-internal-guid-bd18ba5b-7fff-b126-7cfd-dd00ac31586d\">8. Unsubscribe.</b></p>\r\n\r\n<p dir=\"ltr\"><b id=\"docs-internal-guid-bd18ba5b-7fff-b126-7cfd-dd00ac31586d\">If you do not wish to receive certain marketing-related emails from us, you may unsubscribe from receiving them by clicking on the &quot;unsubscribe&quot; link at the bottom of any of those emails. </b></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p dir=\"ltr\"><b id=\"docs-internal-guid-bd18ba5b-7fff-b126-7cfd-dd00ac31586d\">9. Control Over Your Personal Information.</b></p>\r\n\r\n<p dir=\"ltr\"><b id=\"docs-internal-guid-bd18ba5b-7fff-b126-7cfd-dd00ac31586d\">You may review, correct, and/or update certain elements of your Personal Information by adjusting your preferences in the &quot;Your account&quot; section of the Sites. However, neither we nor our third party service providers are responsible for altering Personal Information from the databases and/or other records of third parties with whom we and our third party service providers have previously shared your Personal Information. If you are a California resident under the age of 18 and want to remove your Personal Information from our publicly-displayed content, you can contact us directly at office@EatCayman.net. We may not be able to modify or delete your information in all circumstances.</b></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p dir=\"ltr\"><b id=\"docs-internal-guid-bd18ba5b-7fff-b126-7cfd-dd00ac31586d\">10. Data Retention.</b></p>\r\n\r\n<p dir=\"ltr\"><b id=\"docs-internal-guid-bd18ba5b-7fff-b126-7cfd-dd00ac31586d\">We and our third party service providers will retain Personal Information for at least the period reasonably necessary to fulfill the purposes outlined in this Privacy Policy, unless a longer retention period is required or permitted by law. If we delete some or all of your Personal Information, we may continue to retain and use aggregate or anonymous data previously collected and/or aggregate or anonymize your Personal Information.</b></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p dir=\"ltr\"><b id=\"docs-internal-guid-bd18ba5b-7fff-b126-7cfd-dd00ac31586d\">11. Note Regarding the Use of the Sites by Children.</b></p>\r\n\r\n<p dir=\"ltr\"><b id=\"docs-internal-guid-bd18ba5b-7fff-b126-7cfd-dd00ac31586d\">Under no circumstances are the Sites directed to and/or intended for use by individuals under the age of thirteen (13), and we do not knowingly collect Personal Information from children under age 13. If you believe that we might have any information from a child under 13, please contact us at office@EatCayman.net so that we may delete it as soon as possible.</b></p>\r\n\r\n<p dir=\"ltr\"><b id=\"docs-internal-guid-bd18ba5b-7fff-b126-7cfd-dd00ac31586d\">12. Payment Terms.</b></p>\r\n\r\n<ul>\r\n	<li><strong>Prices. You understand that: (a) the prices for menu items displayed through the Services may differ from the prices offered or published by Food Service Providers for the same menu items and/or from prices available at other third-party websites and that such prices may not be the lowest prices at which the menu items are sold; (b) the Company has no obligation to itemize its costs, profits or margins when publishing such prices; and (c) the Company reserves the right to change such prices at any time, at its discretion. You are liable for all transaction taxes on the Services provided under this Agreement (other than taxes based on the Company&rsquo;s income). Payment will be processed by the Company, using the preferred payment method designated in your account.</strong></li>\r\n	<li><strong>No Refunds. Charges paid by you for completed and delivered orders are final and non-refundable. The Company has no obligation to provide refunds or credits, but may grant them, in each case in Company&rsquo;s sole discretion.</strong></li>\r\n	<li><strong>Promotional Offers. The Company, at its sole discretion, may make promotional offers with different features and different rates to any of our Users. These promotional offers, unless made to you, shall have no bearing whatsoever on your offer or contract. We encourage you to check back at our Website periodically if you are interested in learning more about how we charge for the Software or Services.</strong></li>\r\n	<li><strong>Fees for Services and Software. The Company may change the fees for our Services as we deem necessary or appropriate for our business.</strong></li>\r\n</ul>\r\n\r\n<p dir=\"ltr\"><b id=\"docs-internal-guid-bd18ba5b-7fff-b126-7cfd-dd00ac31586d\">13. Disclaimer.</b></p>\r\n\r\n<p dir=\"ltr\"><b id=\"docs-internal-guid-bd18ba5b-7fff-b126-7cfd-dd00ac31586d\">If you choose to access the Sites, you do so at your own risk and are responsible for complying with all applicable laws, rules, and regulations. We may limit the availability of the Sites, in whole or in part, to any person, geographic area, and/or jurisdiction we choose, at any time and in our sole discretion. By using the Sites and submitting any Personal Information, you consent to the transfer of Personal Information to other countries, which may provide a different level of data security than your country of residence provides.</b></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p dir=\"ltr\"><b id=\"docs-internal-guid-bd18ba5b-7fff-b126-7cfd-dd00ac31586d\">14. Changes to this Policy.</b></p>\r\n\r\n<p dir=\"ltr\"><b id=\"docs-internal-guid-bd18ba5b-7fff-b126-7cfd-dd00ac31586d\">We may change this Privacy Policy from time to time and without prior notice, except that if we make a material change, we will notify you prior to the effective date of the change. Changes to this Privacy Policy will be effective as soon as they are posted, unless a later effective date is provided. By continuing to access and/or use the Sites after the effective date of a revised Privacy Policy, you agree to be bound by the revised Privacy Policy. For clarity, if you do not agree to the new terms of the Privacy Policy, do not continue using the Sites. The most current version of this policy will always be posted on the Sites.</b></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p dir=\"ltr\"><b id=\"docs-internal-guid-bd18ba5b-7fff-b126-7cfd-dd00ac31586d\">15. Contacting Us.</b></p>\r\n\r\n<p dir=\"ltr\"><b id=\"docs-internal-guid-bd18ba5b-7fff-b126-7cfd-dd00ac31586d\">If you have any questions regarding this Privacy Policy, please contact us by email at office@EatCayman.net, or contact us at: </b></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p dir=\"ltr\"><b id=\"docs-internal-guid-bd18ba5b-7fff-b126-7cfd-dd00ac31586d\">Please note that email communications will not necessarily be secure; accordingly, please do not include credit card information and/or other sensitive Personal Information in your email correspondence with us.</b></p>\r\n\r\n<p>&nbsp;</p>', 'Politique de Confidentialit√©', '', 'Active', 'Pol√≠tica de privacidad', '');
