(2, 'USER_SEND_MESSAGE', 'html', 'Job Seeker', 'Inactive', 'User booking for EatCayman', 'Driver #DRIVER_NAME# with Car number\r\n#PLATE_NUMBER# will pickup you on #BOOKING_DATE# at #BOOKING_TIME# for Booking  #BOOKING_NUMBER# you have made with us.', 'User booking for EatCayman', 'Conductor #DRIVER_NAME# con n√∫mero de autom√≥vil\r\n#PLATE_NUMBER# lo recoger√° el #BOOKING_DATE# en #BOOKING_TIME# para la reserva #BOOKING_NUMBER# que ha realizado con nosotros.', 'User booking for EatCayman', 'Pilote #DRIVER_NAME# avec num√©ro de voiture\r\n# #PLATE_NUMBER# vous prendra en charge le #BOOKING_DATE# √† #BOOKING_TIME# pour la r√©servation #BOOKING_NUMBER# que vous avez effectu√©e avec nous.'),
