(4, 'DRIVER_SEND_MESSAGE_JOB_CANCEL', 'html', 'Job Seeker', 'Active', 'Admin Cancel Booking', 'Your booking# #BookingNo# on #Ddate# has been cancelled by Administrator', 'Admin Cancel Booking', 'Su reserva # #BookingNo# en #Ddate# ha sido cancelada por el administrador', 'Admin Cancel Booking', 'Votre r√©servation # #BookingNo# sur #Ddate# a √©t√© annul√©e par l\'administrateur'),
(5, 'USER_SEND_MESSAGE_JOB_CANCEL', 'html', 'Job Seeker', 'Active', 'Admin Cancel Booking', 'Your booking# #BookingNo# on #Ddate# has been cancelled by Administrator', 'Admin Cancel Booking', 'Su reserva # #BookingNo# en #Ddate# ha sido cancelada por el administrador', 'Admin Cancel Booking', 'Votre r√©servation # #BookingNo# sur #Ddate# a √©t√© annul√©e par l\'administrateur'),
(6, 'DRIVER_SEND_MESSAGE_SP', 'html', 'Job Seeker', 'Inactive', 'Driver booking on EatCayman', 'You have new scheduled job request (#Booking_Number#). Please go to app and respond by accept or declining job.', 'Driver booking on EatCayman', 'Tiene una nueva solicitud de trabajo programada (#Booking_Number#). Vaya a la aplicaci√≥n y responda aceptando o rechazando trabajo.', 'Driver booking on EatCayman', 'Vous avez une nouvelle demande de travail planifi√©e (#Booking_Number#). S\'il vous pla√Æt aller √† l\'application et r√©pondre en acceptant ou en refusant le travail.'),
